body:
CleanUnusedInitializers possibly needs to change to use GetInputsIncludingInitializers instead of GetInputs if CanOverrideInitializer() returns true. 

```
void Graph::CleanUnusedInitializers(const std::unordered_set<std::string>* initializer_names_to_preserve) {
  std::unordered_set<std::string> used_args;

  const auto& inputs = GetInputs();
```

And the handling for this edge case needs to only remove the value from the inputs if CanOverrideInitializer returns false (IR version < 4, where initializers could not be overridden and all were listed as graph inputs).
